import React from "react";
import { useSelector } from "react-redux";

function Weather() {
  const reducerData = useSelector((state) => state);
  console.log(reducerData);

  return (
    <div>
      <h1>{reducerData && reducerData.map((data) => <h1>{data.title}</h1>)}</h1>
    </div>
  );
}

export default Weather;
